World War I (The American Heritage Library)
Houghton Mifflin Company | 1987 | 0828104344 | English | 516 pages | PDF | 73 MB

The assassination of the archduke of Austria-Hungary in 1914 triggered more than a monstrous war; it set off a revolution so violent that it reshaped the thoughts and affairs of mankind, perhaps for all time. Marshall's book is a clear one-volume history of the &quot;war to end all wars.&quot;
